import React from "react";
import Card from "../../UI/Card";
import Modal from "../../UI/Modal";

const WaitlistInfoPage = props =>{
    return(
        <Modal>
            <Card>
                <p>Hello World Waitlist Information!</p>
                <button >Close</button>
            </Card>
        </Modal>
    );
};

export default WaitlistInfoPage;
